measurements.description:
Three flowers and one bud on one inflorescence; dorsal sepal cream suffused and striped pale apple green;
    synsepal cream, light green veins;
    petals cream suffused light green, dark green central vein proximally transitioning to violet-brown adjacent to pouch;
    pouch cream overlaid light chestnut, interior cream, dark violet-brown spots; substance average; texture semi-glossy.
